import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Footer from './footer';

const HomePage = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const systemLogText = [
    'System Log',
    'Title: Full Stack Developer',
    'Skills: JavaScript, React, Node.js, Python, Data Analysis, Pandas, Web Scraping',
    'Experience: 5+ years',
    'Booting...',
    'Welcome back, User.',
    'All systems operational.',
    'System update complete.',
  ];

  useEffect(() => {
    const handleResize = () => {
      setIsMobileView(window.innerWidth <= 1050);
    };
    handleResize();
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const commonStyle = {
    color: '#00FF00',
    backgroundColor: '#1A1A1A',
    minHeight: '100vh',
    fontFamily: "'Courier New', Courier, monospace",
    textAlign: 'center',
    padding: '0 20px',
    boxSizing: 'border-box',
  };

  const pipBoyFrameStyle = {
    border: '5px solid #00FF00',
    padding: '20px',
    borderRadius: '10px',
    boxShadow: '0 0 10px 0 rgba(0, 255, 0, 0.5)',
    margin: '0 auto',
    maxWidth: '80%',
    position: 'relative',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'center',
    alignItems: 'center', // Center all content horizontally
  };

  const headerContainerStyle = {
    display: 'flex',
    justifyContent: 'space-between', // To align title and interests to the left and right
    alignItems: 'center',
    width: '100%',
    marginBottom: '30px',
  };

  const systemLogStyle = {
    width: '80%',
    color: '#00FF00',
    fontFamily: "'Courier New', Courier, monospace",
    padding: '20px',
    backgroundColor: '#171717',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0, 255, 0, 0.5)',
    whiteSpace: 'pre-wrap',
    fontSize: '18px',
    lineHeight: '1.6',
    marginBottom: '30px', // Add margin to create space between the log and buttons
  };

  const buttonStyle = {
    padding: '10px 20px',
    border: '2px solid #00FF00',
    color: '#00FF00',
    textDecoration: 'none',
    borderRadius: '5px',
    fontSize: '18px',
    transition: 'background-color 0.3s, color 0.3s',
  };

  const buttonContainerStyle = {
    display: 'flex',
    justifyContent: 'center',
    gap: '1rem',
    marginTop: '2rem', // You can adjust this value to move the buttons closer or further down
  };

  const interestsStyle = {
    backgroundColor: '#2D2D2D',
    color: '#00FF00',
    padding: '20px',
    width: '250px',
    height: 'auto',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0, 255, 0, 0.5)',
    marginTop: '20px',
    border: '2px solid #00FF00',
    textAlign: 'left',
    paddingLeft: '15px',
  };

  return (
    <div style={commonStyle}>
      <div style={pipBoyFrameStyle}>
        <header style={headerContainerStyle}>
          <div>
            <h1 style={{ fontSize: isMobileView ? '25px' : '40px', fontWeight: 'bold' }}>
              Hi, I'm Mohammed 👋
            </h1>
            <p style={{ fontSize: isMobileView ? '18px' : '24px' }}>
              I have been coding and analyzing data for 5+ years 🤖
            </p>
          </div>

          <div style={interestsStyle}>
            <h3>Interests</h3>
            <ul>
              <li>Web Development</li>
              <li>Data Science</li>
              <li>Machine Learning</li>
              <li>Gaming</li>
              <li>Reading</li>
            </ul>
          </div>
        </header>

        <div style={systemLogStyle}>
          {systemLogText.map((line, index) => (
            <div key={index}>{line}</div>
          ))}
        </div>

        <div style={buttonContainerStyle}>
          <Link
            to="/about"
            style={buttonStyle}
            onMouseEnter={(e) => {
              e.target.style.backgroundColor = '#003300';
              e.target.style.color = '#00FF00';
            }}
            onMouseLeave={(e) => {
              e.target.style.backgroundColor = 'transparent';
              e.target.style.color = '#00FF00';
            }}
          >
            About Me
          </Link>
          <a
            href="https://react--portfolio.s3.eu-west-2.amazonaws.com/Mohammed+Bakhshi+CV+.pdf"
            download="Mohammed_Bakhshi_CV.pdf"
            target="_blank"
            rel="noopener noreferrer"
            style={buttonStyle}
            onMouseEnter={(e) => {
              e.target.style.backgroundColor = '#003300';
              e.target.style.color = '#00FF00';
            }}
            onMouseLeave={(e) => {
              e.target.style.backgroundColor = 'transparent';
              e.target.style.color = '#00FF00';
            }}
          >
            View CV
          </a>
        </div>
      </div>

      <Footer />
    </div>
  );
};

export default HomePage;
